import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import Inici from './pages';
import Lobra from './pages/lobra';
import Equip from './pages/'
const App = () => {
  return (
    <Router>
        <Routes>
          <Route path="/" element={<Inici />} />
          <Route path="/inici" element={<Lobra/>}/>
        </Routes>
    </Router>
  )
}

export default App
